import React from "react"

export default function Header()
{
    return(
        <React.Fragment>
          <div class="image-container">
            <img 
              className="myimage" 
              src="https://www.worldanimalprotection.ca/cdn-cgi/image/width=1280,format=auto/siteassets/shutterstock_2461984615.jpg" 
              alt="myimage" />
          </div>
        </React.Fragment>
    )
}
